import { useEffect, useRef } from 'react';

export const Contact = () => {
    const formRef = useRef(null); 

    useEffect(() => {
        const inputs = formRef.current.querySelectorAll('.contact-input');
        inputs.forEach((ipt) => {
            ipt.addEventListener('focus', () => {
                ipt.parentNode.classList.add("focus");
                ipt.parentNode.classList.add("not-empty");
            });
            ipt.addEventListener('blur', () => {
                if (ipt.value === "") {
                    ipt.parentNode.classList.remove("not-empty");
                }
                ipt.parentNode.classList.remove("blur");
            });
        });

        // Il est bon de nettoyer les écouteurs d'événements lors du démontage du composant
        return () => {
            inputs.forEach((ipt) => {
                ipt.removeEventListener('focus');
                ipt.removeEventListener('blur');
            });
        };
    }, []); // Le tableau vide comme dépendance signifie que cet effet s'exécute une fois lors du montage du composant et une fois lors de son démontage

    return (
        // ...
        <div ref={formRef} className="form-wrapper">
<section className="contact">
            <div className="container">
                <div className="left">
                    <div className="form-wrapper">
                        <div className="contact-heading">
                            <h1>Let's work together<span>.</span></h1>
                            <p className="text">Or reach us via : <a href="mailto:owenbolling2@gmail.com">
                                owenbolling2@gmail.com</a></p>
                        </div>

                        <form action="index.html" method="post" className="contact-form">

                            <div className="input-wrap">
                                <input type="text" className="contact-input"
                                    autoComplete="off" name="First Name" required />
                                <label>First Name</label>
                                <i className={<ion-icon name="logo-github"></ion-icon>}></i>
                            </div>

                            <div className="input-wrap">
                                <input type="text" className="contact-input"
                                    autoComplete="off" name="Last Name" required />
                                <label>Last Name</label>
                                <i className={<ion-icon name="logo-github"></ion-icon>}></i>
                            </div>

                            <div className="input-wrap w-100">
                                <input type="email" className="contact-input"
                                    autoComplete="off" name="Email" required />
                                <label>Email</label>
                                <i className={<ion-icon name="logo-github"></ion-icon>}></i>
                            </div>

                            <div className="input-wrap textarea w-100">
                                <textarea name="Message" className="contact-input"
                                autoComplete="off" >
                                </textarea>
                                <label>Message</label>
                                <i className={<ion-icon name="logo-github"></ion-icon>}></i>
                            </div>
                            <div className="contact-buttons w-100">
                                <div className="btn upload">
                                    <span>
                                    <i class="fa-solid fa-paperclip"></i>
                                    </span>
                                </div>
                            </div>
                        </form>
                    </div>
                </div>
                <div className="right"></div>
            </div>
        </section>
        </div>
        // ...
    );
}
